import React from "react";
import Fab from '@material-ui/core/Fab';


function SearchBar() {
    return (
        <form className="searchInput">
            <input name="title"
                placeholder="Title" />
            <Fab>Search</Fab>
        </form>
    )

}


export default SearchBar
